import axios from 'axios';

const proxyURL = 'https://cors-anywhere.herokuapp.com';

const headers = {
    'Content-Type': 'application/json',
    Accept: 'application/json',
};

const api = axios.create({
    baseURL: `${proxyURL}/http://52.45.128.89`,
});

export default api;
